import React, { useEffect, useState } from 'react';
import axios from 'axios';

const SeaCreatures = () => {

    const [seas, setSeas] = useState("");

    useEffect (() => {
        axios.get(`https://acnhapi.com/v1a/sea`)
        .then(response => {
            console.log(response.data);
            setSeas(response.data)
        })
        .catch(error => {
            console.log(error)
        })
}, []);

    return (<div>
        {/* {JSON.stringify(seas)} */}
        <h1>Sea Creatures</h1>
            {seas ?
                seas.map((sea, idx) => {
                    return (
                            <img style={{width: "75px"}} key={sea.id} src={`https://acnhapi.com/v1/images/sea/${sea.id}`}/>
                    )
                })
            :
            <p>Loading..</p>}
    </div>)
};

export default SeaCreatures;
